import React, { Component } from 'react'

import './SidePage.css'
import SideMenu from './side-menu/SideMenu';

class SidePage extends Component {
  render() {
    return (
      <div className="side-bar">
        <SideMenu/>
      </div>
    )
  }
}

export default SidePage
